import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import HomePage from './Homepage';
import LoginPage from './loginpage';

function App() {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<HomePage />}/>
          <Route path="/loginPage" element={<LoginPage />} />
        </Routes>
    </Router>
  );
}

export default App;
